import 'date-fns';
import React from 'react';
import {List, Datagrid,TextField, EditButton, SimpleForm, Edit, TextInput, Create} from 'react-admin';

import {
    KeyboardDatePicker,
  } from '@material-ui/pickers';

export const PasienList = props => (
    <List {...props}>
        <Datagrid>
            <TextField source="id" />
            <TextField source="nama" />
            <TextField source="alamat" />
            <TextField source="telepon" />
            <TextField source="ttl" />
            <TextField source="gender" />
            <TextField source="tanggalDaftar" />
            <EditButton />
        </Datagrid>
    </List>
);

export const PasienEdit = props => (
    <Edit {...props}>
        <SimpleForm>
            <TextInput source="id" />
            <TextInput source="nama" />
            <TextInput source="alamat" />
            <TextInput source="telepon" />
            <KeyboardDatePicker
          margin="normal"
          id="date-picker-dialog"
          label="Date picker dialog"
          format="MM/dd/yyyy"
          source="ttl"
          KeyboardButtonProps={{
            'aria-label': 'change date',
          }}
        />
            <TextInput source="gender" />
            <TextInput source="tanggalDaftar" />
        </SimpleForm>
    </Edit>
); 

export const PasienCreate = props => (
    <Create {...props}>
        <SimpleForm>
            <TextInput source="id" />
            <TextInput source="nama" />
            <TextInput source="alamat" />
            <TextInput source="telepon" />
            <TextInput source="ttl" />
            <TextInput source="gender" />
            <TextInput source="tanggalDaftar" />
        </SimpleForm>
    </Create>
);
